import {Component, OnInit} from '@angular/core';
import {TodosService} from './store/todos';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent implements OnInit {
  title = 'Todo list';

  constructor(
    private todosService: TodosService,
  ) {
  }

  ngOnInit(): void {
    this.todosService.get().subscribe();
  }

}

import {Component, EventEmitter, OnInit, Output} from '@angular/core';

@Component({
  selector: 'app-form',
  templateUrl: './form.component.html',
  styleUrls: ['./form.component.scss']
})
export class FormComponent implements OnInit {

  @Output()
  addTodo = new EventEmitter<string>();

  constructor() { }

  ngOnInit(): void {
  }

  add(input: HTMLInputElement): void {
    if (input.value) {
      this.addTodo.emit(input.value);
      input.value = '';
    }
  }

}

import {Component, EventEmitter, Input, Output} from '@angular/core';
import {ID} from '@datorama/akita';

import {Todo} from '../../store/todos';

@Component({
  selector: 'app-todo-item',
  templateUrl: './todo-item.component.html',
  styleUrls: ['./todo-item.component.scss']
})
export class TodoItemComponent {

  @Input()
  todo!: Todo;

  @Output()
  complete = new EventEmitter<Todo>();

  @Output()
  delete = new EventEmitter<ID>();

  handleComplete(): void {
    this.complete.emit({...this.todo, completed: !this.todo.completed});
  }

}

